import React from "react";
import clsx from "clsx";
import { makeStyles } from "@material-ui/core/styles";
import MenuItem from "@material-ui/core/MenuItem";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";

const clients = [
  {
    value: "John Smith",
    label: "John Smith"
  },

  {
    value: "Jill Smith",
    label: "Jill Smith"
  },
  {
    value: "Ashley Flowers",
    label: "Ashley Flowers"
  }
];

const therapists = [
  {
    value: "Therapist 1",
    label: "Therapist 1"
  },

  {
    value: "Harry Potter",
    label: "Harry Potter"
  },
  {
    value: "Therapist 3",
    label: "Therapist 3"
  }
];

const useStyles = makeStyles(theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap"
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 400
  },
  textField2: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200
  }
}));

export default function OutlinedTextFields() {
  const classes = useStyles();
  const [values, setValues] = React.useState({
    client: "John Smith",
    therapist: "Harry Potter",
    location: "Room 2",
    duration: "30 minutes"
  });

  const handleChange = name => event => {
    setValues({ ...values, [name]: event.target.value });
  };

  return (
    <Grid container direction="column" justify="center" alignItems="flex-start">
      <TextField
        id="standard-select-client"
        select
        label="Client"
        variant="outlined"
        margin="normal"
        className={classes.textField}
        value={values.newClient}
        onChange={handleChange("newClient")}
        SelectProps={{
          MenuProps: {
            className: classes.menu
          }
        }}
      >
        {clients.map(option => (
          <MenuItem key={option.value} value={option.value}>
            {option.label}
          </MenuItem>
        ))}
      </TextField>
      <TextField
        id="standard-select-client"
        select
        label="Therapist"
        variant="outlined"
        margin="normal"
        className={classes.textField}
        value={values.Therapist}
        onChange={handleChange("Therapist")}
        SelectProps={{
          MenuProps: {
            className: classes.menu
          }
        }}
      >
        {therapists.map(option => (
          <MenuItem key={option.value} value={option.value}>
            {option.label}
          </MenuItem>
        ))}
      </TextField>
      <Grid direction="row">
        <TextField
          id="standard-newLocation"
          label="Location"
          variant="outlined"
          className={classes.textField2}
          value={values.Location}
          onChange={handleChange("Location")}
          margin="normal"
        />
        <TextField
          id="standard-newDuration"
          label="Duration (minutes)"
          variant="outlined"
          className={classes.textField2}
          value={values.newDuration}
          onChange={handleChange("Duration")}
          margin="normal"
        />
      </Grid>
    </Grid>
  );
}
